// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../FundsManager.sol";

contract MockSong {
    FundsManager private fundsManager;

    function initialize(address _fundsManager) external {
        fundsManager = FundsManager(_fundsManager);
    }

    function callUpdateSongStaking(
        uint256 stakedTraxAmount,
        address stablecoinAddress,
        uint256 stakedStablecoinAmount
    ) external {
        fundsManager.updateSongStaking(stakedTraxAmount, stablecoinAddress, stakedStablecoinAmount);
    }

    function callTransferStablecoinTo(
        address receiver,
        address stablecoinAddress,
        uint256 amount
    ) external {
        fundsManager.transferStablecoinTo(receiver, stablecoinAddress, amount);
    }
}
